svg.script:
var nframes = 24; 			// Number of frames in animation

var current_frame = -1; 	// Current frame, first frame is numbered 0.

var direction = 1; 			// Direction of animation, 1 to move up in frame

									 // numbers, -1 to move down.


/*

* Function to save pointers to various parts of this document in global

* variables. These variables are used in the animation functions.

*/
function on_load (evt)

{

	// This makes the next_frame function available to JavaScript functions

	// defined outside of the SVG document. This is needed so that the

	// setInterval function can find and call next_frame when needed.

	window.anim1_01_next_frame = next_frame;
	window.anim1_01_document = document;
	window.setInterval ('anim1_01_next_frame()', 100);

}



/*

* This function implements the animation. At each invocation, the function

* increments or decrements the frame number (global variable

* current_frame) according to the value of the global variable direction,

* makes the new frame visible, and makes the previous frame invisible. A

* "frame" here is one group of SVG elements.

*/

function next_frame ()

{

	var svgobj;

	var svgstyle;

	var document = window.anim1_01_document;

	var previous_frame = current_frame;



	// Increment/decrement current frame number.

	current_frame += direction;



	// When we go beyond the last or the first frame, we change directions

	// and set the frame number to [last frame - 1] or 1. This makes the

	// figures look like they're bouncing back-and-forth.

	if (current_frame >= nframes)

	{

		current_frame = nframes-2;

		direction = -1;

	}

	else if (current_frame < 0)

	{

		current_frame = 1;

		direction = 1;

	}



	// Now we make the current frame visible.

	svgobj = document.getElementById('gradient_star_'+current_frame);

	svgstyle = svgobj.style;

	svgstyle.setProperty('visibility', 'visible', '');



	// Make previous frame invisible. On first call, previous_frame = -1 so

	// there is really no frame to make invisible.

	if (previous_frame >= 0)

	{

		svgobj = document.getElementById('gradient_star_'+previous_frame);

		svgstyle = svgobj.style;

		svgstyle.setProperty('visibility', 'hidden', '');

	}

}
